import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function SignupData(){
	const[user,setuser] = useState([]);
	useEffect(()=>
{axios.get('http://localhost:4000/signupdetails')
.then(user=>setuser(user.data)).catch(err=>console.log(err))
    
console.log(user);

},[])
    return(

		<div>






		
			
		  
			
					<div class="container-fluid mt-3">
					   <div className="row">
						<div className="col-lg-12">
		<div className="card">
		
		
			<div class="container">
		
			{
                user.map((data , index)=>
               <div className="col-lg-3 col-md-6 col-sm-12">


  <img src={`images/${data.file}`} width="50%" height="20px" /> 
  <h4>{data.name}</h4>
  <h4>{data.email}</h4>
         
  <h4>{data.number}</h4>
  <h4>{data.address}</h4>
           
  <h4>{data.starttime}</h4>
  <h4>{data.endtime}</h4>
  <h4>{data.role}</h4>
                </div>
                   

                   
                    
                  

                   )
            }
					
					
							</div>
		
						
				   
				
		
			   
		
						
		
					 
					</div>
					
				</div>
			  
				
				
		
			
			  
			</div>
			
		   
		
			 
			
		
		
		
		
		
			
				</div>

       </div>
    )
}

export default SignupData
